  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the findings and
  recommendations of a wildlife and habitat management review conducted by a review
  team during November 13-17, 2000 at the Malheur National Wildlife Refuge (MNWR).
  Its purposes were the following: I) determine if management strategies support refuge
  purposes as well as the National Wildlife Refuge Improvement Act and other Service
  policies regarding fish and wildlife management; 2) identify the long-term vision
  for habitat and wildlife management of the refuge; 3) identify measures, if needed,
  that would improve refuge wildlife and habitat management as well as contribute
  to ecological integrity of the System from local, regional, ecosystem, and national
  scales; 4) identify inventory, monitoring, and research needs required to implement
  adaptive management; 5) identify staffing/equipment needs required to optimize refuge
  management and develop RONS packages to accomplish/address the highest biological
  and habitat management recommendations; and 6) identify management priorities and
  strategies to be used in the development of comprehensive conservation plans and
  habitat management plans. The recommendations were formulated by the refuge staff
  and core review team members identified below during the site visit.\",\n\t\"owner_org\":
